import React, {Component} from 'react';

class Jiyeon extends Component {
    static defaultProps = {name:'강지연'}

    render() {
       return(
            <div>Just wanna introduce my self. My name is <b>{this.props.name}</b></div>
        );
    }
}

export default Jiyeon;
